<p>{{ Workflow | Attribute:'StudentLeader','NickName' }},</p>

<p>Our first video had Matt Densky talking about the vision of FG Students. It was a great refresher about Belong Believe Become. In this second video Matt Densky gives some important information about Generation Z and how they think so that you can be more prepared as you lead students within this generation. He talks about “screenagers,” the idea for real safety, a post-Christian worldview, safe spaces, and more. They are primed to be diverse, accepting, and care about the world. Watch <a href="https://www.fellowshipgreenville.org/page/1777" target = "_blank">Gen Z "Crash Course"</a>.</p>

<p>Thanks.</p>

<p>FGS Students Staff</p>

